import React from "react";
import {CircleTickOutlineMinor} from '@shopify/polaris-icons';
import { Stack, TextContainer,Button } from "@shopify/polaris";

const NotificationItem = ({content}) => {
    return (
        <Stack>
        <Stack.Item>
            <Icon
                source={CircleTickOutlineMinor}
                color="base" />
        </Stack.Item>
        <Stack.Item fill>
            <TextContainer>{content}</TextContainer>
        </Stack.Item>
        <Stack.Item>
            <Button plain>Add</Button>
        </Stack.Item>
        <Stack.Item>
            <Button plain destructive>Delete</Button>
        </Stack.Item>
    </Stack>
    )
}

export default NotificationItem
